function Signup(){
    return(
        <div class='container'>
            <form>
                <div class='form-row'>
                    <div class='form-group col-md-6'>
                        <label for='email' class='form-label'>Email</label>
                        <input type='email' id='email' class='form-control'/>      
                    </div>
                </div> 
            </form>
        </div>
    )
}

export default Signup;
